   // the idea is that in a future release we will have a base library that 
   // initializes these to "useable" default implementations and probably 
   // helpers to more easily define read_action_data and action_data_size intrinsics
   // like these"
   intrinsics::set_intrinsic(
         [](void* m, uint32_t len) {
            check(len (
         []() {
            return (uint32_t)sizeof(eosio::name);
         });

   intrinsics::set_intrinsic(
         [](capi_name nm) {
         });


   // "Name : hello" should be in the print buffer
   CHECK_PRINT("Name : hello",
         []() {
            apply("test"_n.value, "test"_n.value, "hi"_n.value);
            });

   // should not assert
   apply("test"_n.value, "test"_n.value, "check"_n.value);

   name nm = "null"_n;
   intrinsics::set_intrinsic(
         [&](void* m, uint32_t len) {
            check(len 
Every intrinsic that is defined for eosio (prints, require_auth, etc.) is redefinable given the intrinsics::set_intrinsics() functions.  These take a lambda whose arguments and return type should match that of the intrinsic you are trying to define.  This gives the contract writer the flexibility to modify behavior to suit the unit test being written. A sister function intrinsics::get_intrinsics() will return the function object that currently defines the behavior for said intrinsic.  This pattern can be used to mock functionality and allow for easier testing of smart contracts.  For more information please see, either the ./tests directory or ./examples/hello/tests/hello_test.cpp for working examples.
Compiling Native Code

Raw eosio-cpp to compile the test or program the only addition needed to the command line is to add the flag -fnative this will then generate native code instead of wasm code.
Via CMake
add_native_library and add_native_executable CMake macros have been added (these are a drop in replacement for add_library and add_executable).



Eosio.CDT Native Tester API

CHECK_ASSERT(...) : This macro will check whether a particular assert has occured and flag the tests as failed but allow the rest of the tests to run.  
This is called either by 
CHECK_ASSERT("", [](){ whatever_function(); })
CHECK_ASSERT([](std::string msg){ user defined comparison function }, [](){ whatever_function(); })




CHECK_PRINT(...) : This macro will check whether the print buffer holds the string that is expected and flag the tests as failed but allow the rest of the test to run.
This is called either by 
CHECK_PRINT("", [](){ whatever_function(); })
CHECK_PRINT([](std::string print_buffer){ user defined comparison function }, [](){ whatever_function(); })




CHECK_EQUAL(X, Y) : This macro will check whether two inputs equal eachother and fail the test but allow the rest of the test to continue.
REQUIRE_ASSERT(...) : This macro will check whether a particular assert has occured and flag the tests as failed and halt the test on failure.  
This is called either by 
REQUIRE_ASSERT("", [](){ whatever_function(); })
REQUIRE_ASSERT([](std::string msg){ user defined comparison function }, [](){ whatever_function(); })




REQUIRE_PRINT(...) : This macro will check whether the print buffer holds the string that is expected and flag the tests as failed and halt the test on failure.
This is called either by 
REQUIRE_PRINT("", [](){ whatever_function(); })
REQUIRE_PRINT([](std::string print_buffer){ user defined comparison function }, [](){ whatever_function(); })




REQUIRE_EQUAL(X, Y) : This macro will check whether two inputs X and Y equal eachother and fail the test and halt the test on failure.
EOSIO_TEST_BEGIN(X) : This macro defines the beginning of a unit test and assigns X as the symbolic name of that test.
EOSIO_TEST_END : This macro defines the end of a unit test.
EOSIO_TEST(X) : This is used to run a particular named unit test X in the main function.

group__multiindex.html.body:
group multiindex
Defines EOSIO Multi Index Table. More...
Classes



Type
Name




struct
eosio::indexed_by



Detailed Description
EOSIO Multi-Index API provides a C++ interface to the EOSIO database. It is patterned after Boost Multi Index Container. EOSIO Multi-Index table requires exactly a uint64_t primary key. For the table to be able to retrieve the primary key, the object stored inside the table is required to have a const member function called primary_key() that returns uint64_t. EOSIO Multi-Index table also supports up to 16 secondary indices. The type of the secondary indices could be any of:

uint64_t
uint128_t
double
long double
eosio::checksum256

Template parameters:

TableName - name of the table 
T - type of the data stored inside the table 
Indices - secondary indices for the table, up to 16 indices is supported here

Example:
#include 
using namespace eosio;
class mycontract: contract {
  struct record {
    uint64_t    primary;
    uint64_t    secondary_1;
    uint128_t   secondary_2;
    checksum256 secondary_3;
    double      secondary_4;
    long double secondary_5;
    uint64_t primary_key() const { return primary; }
    uint64_t get_secondary_1() const { return secondary_1; }
    uint128_t get_secondary_2() const { return secondary_2; }
    checksum256 get_secondary_3() const { return secondary_3; }
    double get_secondary_4() const { return secondary_4; }
    long double get_secondary_5() const { return secondary_5; }
  };
  public:
    mycontract(name receiver, name code, datastream ds):contract(receiver, code, ds){}
    void myaction() {
      auto code = _self;
      auto scope = _self;
      multi_index >,
        indexed_by >,
        indexed_by >,
        indexed_by >,
        indexed_by >
      > table( code, scope);
    }
}
EOSIO_DISPATCH( mycontract, (myaction) )

Functions Documentation
function multi_index
multiindex::multi_index (
    name code,
    uint64_t scope
)

load_object_by_primary_iterator 
Constructs an instance of a Multi-Index table.
Parameters:

code - Account that owns table 
scope - Scope identifier within the code hierarchy

Precondition:
code and scope member properties are initialized 
Post
each secondary index table initialized 
Post
Secondary indices are updated to refer to the newly added object. If the secondary index tables do not exist, they are created. 
Post
The payer is charged for the storage usage of the new object and, if the table (and secondary index tables) must be created, for the overhead of the table creation.
Notes The ` template has template parameters

TableName is the name of the table, maximum 12 characters long, characters in the name from the set of lowercase letters, digits 1 to 5, and the "." (period) character and is converted to a eosio::raw - which wraps uint64_t;
T is the object type (i.e., row definition);
Indices is a list of up to 16 secondary indices.
Each must be a default constructable class or struct
Each must have a function call operator that takes a const reference to the table object type and returns either a secondary key type or a reference to a secondary key type
It is recommended to use the eosio::const_mem_fun template, which is a type alias to the boost::multi_index::const_mem_fun. See the documentation for the Boost const_mem_fun key extractor for more details.

Example:
#include 
using namespace eosio;
using namespace std;
class addressbook: contract {
  struct address {
     uint64_t account_name;
     string first_name;
     string last_name;
     string street;
     string city;
     string state;
     uint64_t primary_key() const { return account_name; }
  };
  public:
    addressbook(name self):contract(self) {}
    typedef eosio::multi_index address_index;
    void myaction() {
      address_index addresses(_self, _self.value); // code, scope
    }
}
EOSIO_DISPATCH( addressbook, (myaction) )

